  wdot[57] += q; // nc4h9co
  wdot[81] -= q; // c7h14o1-3
  // d()/d[oh]
  dqdci = +k_f * sc[81];
  J[360] -= dqdci; // dwdot[oh]/d[oh]
  J[361] += dqdci; // dwdot[h2o]/d[oh]
  J[372] += dqdci; // dwdot[c2h4]/d[oh]
  J[413] += dqdci; // dwdot[nc4h9co]/d[oh]
