  // a non-third-body and non-pressure-fall-off reaction
  // forward
  phi_f = sc[11] * sc[82];
  k_f = 5000000 * exp(-(8906.93498474354) * invT);
  dlnkfdT = (8906.93498474354) * invT2;
  // rate of progress
  q = k_f * phi_f;
  dqdT = dlnkfdT * k_f * phi_f;
